In the Bitcoin P2P protocol messages are preceded by 4 magic values or bytes. These values are used to delimit when a new message starts in a byte stream and also are used to indicate which of the Bitcoin networks the node is speaking on, such as TestNet or Mainnet. Tari message packets are encapsulated using the Noise protocol, so we do not need the delimiting functionality of these bytes. Once we have a Noise socket we are able to send/receive bytes as with any other socket, but those bytes are encrypted over the wire. Using that socket we send yamux packets and messaging/rpc messages are length-delimited . Tari includes a single WireMode byte at the beginning of every connection session. This byte indicates which network a node is communicating on, so that if the counterparty is on a different network it can reject this connection cheaply without having to perform any further operations, like completing the Noise protocol handshake. The following is the current mapping of the WireMode byte: pub enum Network { MainNet = 0x00, LocalNet = 0x10, Ridcully = 0x21, Stibbons = 0x22, Weatherwax = 0xa3, Igor = 0x24, Dibbler = 0x25, Esmeralda = 0x26,
} // As well as the special wiremode for local liveness checks
const LIVENESS_WIRE_MODE: u8 = 0xa6;

