We define a clear notation for covenants that mirrors the miniscript project. Execution Context and Scope Covenants execute within a limited read-only context and scope. This is both to reduce complexity (and therefore the possibility of bugs) and maintain reasonable performance. A covenant's context is limited to: an immutable reference to the current input, a vector of immutable references to outputs in the current block/transaction (called the output set), the current input's mined height, and the current block height. Each output's covenant is executed with this context, filtering on the output set and returning the result. The output set given to each covenant at execution MUST be the same set for all covenants and MUST never be influenced by other covenants. The stateless and immutable nature of this scheme has the benefit of being able to execute covenants in parallel. A covenant passes if at least one output in the set is matched. Allowing more than one output to match allows for covenants that restrict the characteristics of multiple outputs. A covenant that matches zero outputs fails which invalidates the transaction/block. If a covenant is empty (zero bytes) the identity operation is implied and therefore, no actual execution need occur. Argument types enum CovenantArg { // byte code: 0x01 // data size: 32 bytes Hash([u8; 32]), // byte code: 0x02 // data size: 32 bytes PublicKey(RistrettoPublicKey), // byte code: 0x03 // data size: 32 bytes Commitment(PedersonCommitment), // byte code: 0x04 // data size: variable TariScript(TariScript), // byte code: 0x05 // data size: <= 4096 bytes Covenant(Covenant), // byte cide: 0x06 // data size: variable Uint(u64), // byte cide: 0x07 // data size: variable OutputField(OutputField), // byte cide: 0x08 // data size: variable OutputFields(OutputFields), // byte cide: 0x09 // data size: variable Bytes(Vec<u8>), // byte cide: 0x0a // data size: 1 bytes OutputType(OutputType),
} Output field tags Fields from each output in the output set may be brought into a covenant filter. The available fields are defined as follows: Tag Name Byte Code Returns field::commitment 0x00 output.commitment field::script 0x01 output.script field::sender_offset_public_key 0x02 output.sender_offset_public_key field::covenant 0x03 output.covenant field::features 0x04 output.features field::features_output_type 0x05 output.features.output_type field::features_maturity 0x06 output.features.maturity field::features_metadata 0x07 output.features.metadata field::features_sidechain_features 0x08 output.features.sidechain_features Each field tag returns a consensus encoded byte representation of the value contained in the field. How those bytes are interpreted depends on the covenant. For instance, filter_fields_hashed_eq will concatenate the bytes and hash the result whereas filter_field_eq will interpret the bytes as a little-endian 64-bit unsigned integer. Set operations identity() The output set is returned unaltered. This rule is implicit for an empty (0 byte) covenant. op_byte: 0x20 args: [] and(A, B) The intersection (\(A \cap B\)) of the resulting output set for covenant rules \(A\) and \(B\). op_byte: 0x21 args: [Covenant, Covenant] or(A, B) The union (\(A \cup B\)) of the resulting output set for covenant rules \(A\) and \(B\). op_byte: 0x22 args: [Covenant, Covenant] xor(A, B) The symmetric difference (\(A \triangle B\)) of the resulting output set for covenant rules \(A\) and \(B\). This is, outputs that match either \(A\) or \(B\) but not both. op_byte: 0x23 args: [Covenant, Covenant] not(A) Returns the compliment of A. That is, all the elements of A are removed from the resultant output set. op_byte: 0x24 args: [Covenant] Filters filter_output_hash_eq(hash) Filters for a single output that matches the hash. This filter only returns zero or one outputs. op_byte: 0x30 args: [Hash] filter_fields_preserved(fields) Filter for outputs where all given fields in the input are preserved in the output. op_byte: 0x31 args: [Fields] filter_fields_hashed_eq(fields, hash) op_byte: 0x32 args: [Fields, VarInt] filter_field_eq(field, int) Filters for outputs whose field value matches the given integer value. If the given field cannot be cast to an unsigned 64-bit integer, the transaction/block is rejected. op_byte: 0x33 args: [Field, VarInt] filter_absolute_height(height) Checks the block height that the current UTXO (i.e. the current input) is greater than or equal to the HEIGHT block height. If so, the identity() is returned. op_byte: 0x34 args: [VarInt] Encoding / Decoding Covenants can be encoded to/decoded from bytes as a token stream. Each token is consumed and interpreted serially before being executed. For instance, xor( filter_output_hash_eq(Hash(0e0411c70df0ea4243a363fcbf161ebe6e2c1f074faf1c6a316a386823c3753c)), filter_relative_height(10),
) is represented in hex bytes as 23 30 01 a8b3f48e39449e89f7ff699b3eb2b080a2479b09a600a19d8ba48d765fe5d47d 35 07 0a. Let's unpack that as follows: 23 // xor - consume two covenant args
30 // filter_output_hash_eq - consume a hash arg
01 // 32-byte hash
a8b3f48e39449e89f7ff699b3eb2b080a2479b09a600a19d8ba48d765fe5d47d // data
// end filter_output_hash_eq
35 // 2nd covenant - filter_absolute_height
07 // varint
0A // 10
// end varint, filter_absolute_height, xor Some functions can take any number of arguments, such as filter_fields_hashed_eq which defines the Fields type. This type is encoded first by its byte code 34 followed by a varint encoded number that indicates the number of field identifiers to consume. To mitigate misuse, the maximum allowed arguments are limited.

