In this example, Alice wants to allow Bob to spend 100 of a fungible asset called WARI from her account. Let's assume the transfer function looks like this: fn transfer(amount: u64, from: PublicKey, to: PublicKey) { requires_scope("transfer", from); // ...
} Alice creates a token: /* bob's token */
{ "scopes": ["transfer"], "granted_to": "<Bob's Public Key>", "caveats": [ "amount le 100" ], "issuer": "<Alice's Public Key>", "issuer_sig": "<sig>"
} Note: The root_nonce and expires_at_height are missing here, but it would have been better for Alice to include these. Also, this token allows Bob to spend up to 100 at a time, but does not restrict Bob from using this token again Bob can now create the instruction and submit it to the validator node. The validator node checks that the instruction signature matches the public key in granted_to and also checks that the amount parameter is less than or equal to 100. Finally, the validator node checks that the scope includes 'transfer', and Alice's public key (specified in from) matches the auth token's issuer signature.

