The block hash pre-image is constructed by first constructing the merge mining hash. Each encoding is concatenated in order as follows: version - 1 byte height - varint prev_hash - fixed 32-bytes timestamp - varint input_mr - fixed 32-bytes output_mr - fixed 32-bytes output_mmr_size - varint witness_mr - fixed 32-bytes kernel_mr - fixed 32-bytes kernel_mmr_size - `varint total_kernel_offset - 32-byte Scalar, see RistrettoPrivateKey total_script_offset - 32-byte Scalar, see RistrettoPrivateKey This pre-image is hashed and block hash is constructed, in order, as follows: merge_mining_hash - As above pow_algo - enumeration of types of PoW as a single unsigned byte, where Monero = 0x00 and Sha3 = 0x01 pow_data - raw variable bytes (no length varint) nonce - the PoW nonce, u64 converted to a fixed 8-byte array (little endian) Output Features pub struct OutputFeatures { pub version: OutputFeaturesVersion, pub maturity: u64, pub flags: OutputFlags, pub metadata: Vec<u8>, pub unique_id: Option<Vec<u8>>, pub parent_public_key: Option<PublicKey>, pub asset: Option<AssetOutputFeatures>, pub mint_non_fungible: Option<MintNonFungibleFeatures>, pub sidechain_checkpoint: Option<SideChainCheckpointFeatures>,
} Output features consensus encoding is defined as follows (in order): version - 1 unsigned byte. This should always be 0x00 but is reserved for future proofing. maturity - varint flags - 1 unsigned byte metadata - dynamic vector unique_id - nullable + dynamic vector parent_public_key - nullable + 32-byte compressed public key asset - nullable + AssetOutputFeatures mint_non_fungible - nullable + MintNonFungibleFeatures sidechain_checkpoint - nullable + SideChainCheckpointFeatures AssetOutputFeatures public_key - RistrettoPublicKey template_ids - dynamic vector + varint template_parameters - dynamic vector MintNonFungibleFeatures asset_public_key - RistrettoPublicKey asset_owner_commitment - RistrettoPublicKey SideChainCheckpointFeatures merkle_root - fixed sized array committee - dynamic vector + RistrettoPublicKey Transaction Output pub struct TransactionOutput { pub version: TransactionInputVersion, pub features: OutputFeatures, pub commitment: Commitment, pub proof: RangeProof, pub script: TariScript, pub sender_offset_public_key: PublicKey, pub metadata_signature: ComSignature, pub covenant: Covenant,
} The canonical output hash is appended to the output Merkle tree and commits to the common data between an output and the input spending that output i.e. output_hash = Hash(version | features | commitment | script | covenant). The encoding is defined as follows: version - 1 byte features - OutputFeatures commitment - RistrettoPublicKey script - byte length as varint + TariScript covenant - byte length as varint + Covenant Witness hash The witness hash is appended to the witness Merkle tree. proof - Raw proof bytes encoded using dynamic vector encoding metadata_signature - [CommitmentSignature] Metadata signature challenge See Metadata Signature for details. public_commitment_nonce - RistrettoPublicKey script - byte length as varint + TariScript features - OutputFeatures sender_offset_public_key - RistrettoPublicKey commitment - RistrettoPublicKey covenant- byte length as varint + Covenant

